// Script para nó Code - Processar resposta da UAZ API
// Input: Resposta da UAZ API com lista de grupos
// Output: Array com chat_id e nome de cada grupo

const inputData = $input.all();
const processedGroups = [];

// Iterar sobre cada item do input
for (const item of inputData) {
  const data = item.json;

  // Verificar se há grupos na resposta
  if (data && data.groups && Array.isArray(data.groups)) {

    // Processar cada grupo
    for (const group of data.groups) {
      // Extrair apenas os números do JID (antes do @)
      const chatId = group.JID.split('@')[0];

      // Criar objeto com os dados necessários
      const processedGroup = {
        chat_id: chatId,
        group_name: group.Name,
        original_jid: group.JID
      };

      processedGroups.push(processedGroup);
    }
  }
}

// Retornar array de grupos processados
return processedGroups.map(group => ({
  json: group
}));

// Script para normalizar participantes por grupo
const inputData = $input.all();
const groupsToProcess = [];

// Processar cada item do input
for (const item of inputData) {
  const groupData = item.json;

  // Verificar se é um grupo válido com participantes
  if (groupData && groupData.JID && groupData.Participants && Array.isArray(groupData.Participants)) {

    // Extrair chat_id do JID (números antes do @)
    const chatId = groupData.JID.split('@')[0];

    // Processar participantes
    const participants = groupData.Participants.map(participant => {
      // Extrair apenas os números do telefone (remover @s.whatsapp.net)
      const phoneNumber = participant.PhoneNumber.split('@')[0];

      return {
        phone: phoneNumber
      };
    });

    // Criar objeto do grupo processado
    const processedGroup = {
      group_chat_id: chatId,
      group_name: groupData.Name,
      group_jid: groupData.JID,
      total_participants: participants.length,
      participants: participants,
      // Array para facilitar uso na query
      phone_numbers: participants.map(p => p.phone)
    };

    groupsToProcess.push(processedGroup);
  }
}

// Retornar um item para cada grupo (para processamento individual)
return groupsToProcess.map(group => ({
  json: group
}));
